import '../styles/App.css';
import React from 'react'

const Comments = ({items}) => {
	return items.map((i) => {
		return (
<div key={i.id}>
			<span>{i.name}</span>
			<div>
				{i.body}
			</div>
		</div>
		);
	})
}
export default Comments
